import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import state from "./redux/state";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App DialogsData = {state.dialogs}  MessageData = {state.messages} postData={state.posts} BurgerItems = {state.links} BurgerLogo = {state.logo}/>
  </React.StrictMode>
);

reportWebVitals();
